import React, {Component, Fragment} from 'react';

class Header extends Component {
  shouldComponentUpdate(){
    return false;
  }
  render(){
    console.log("Header");
    return(
      <Fragment>
        <h1>{this.props.title}</h1>
        {this.props.body}
      </Fragment>
    )
  }
}

export default Header;
